import { connect } from 'react-redux';

import {  changeMessage } from './../../actions';

const actions = props => {
    return props.changeMessage('Factory');
};

const useAction = connect(null,
    {
        changeMessage,
    })(actions);



const instantEffects = {
    Factory: () => {
        //When constructed, select 1 of 5 resources. This resource becomes the wild.
        //get all non wild resources

        //select one resourse

        //change selected to "wild"
        console.log("Fact");
        console.log(useAction);

        useAction();
    }

};



export default instantEffects;
